import React from "react";

import { MenuList } from "../helpers/articlelist";

import Log from "../assets/image9.jpg";
import MenuItem from "../components/article";
import "../styles/book.css";
import BookImage1 from "../assets/image1.jpg"; // Replace with the actual image file name
import BookImage2 from "../assets/image2.jpg"; // Replace with the actual image file name
import BookImage3 from "../assets/im.jpg"; // Replace with the actual image file name


function Ab() {
  return (
    <div className="about" style={{ backgroundImage: `url(${Log})` }}>
      <div
        className="aboutTop"
        
      ></div>
      <div className="aboutBottom">
        <h1>ARTICLES</h1>
        <div className="menu">
         
          <div className="menuList">
            {MenuList.map((menuItem, key) => {
              return (
                <MenuItem
                  key={key}
                  image={menuItem.image}
                  name={menuItem.name}
                  author={menuItem.author}
                />
              );
            })}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Ab;
